import Products from "./product/Product";

class App extends React.Component{
  state = {
    product: product
  }

  render() {
    return (
    <Wrapper>
      <Title title= {'Product'}/>
      {this.state.product.map((product)=> {
        return(
          <Product
          name={product.name}
          image={product.image}
          occupation={product.occupation}
          location={product.location}/>
        )
        })}
    </Wrapper>
  );
}
}


export default App;
